import { Button, Col, Row } from 'react-bootstrap';
import React from 'react';
import '../App.css';

export default function Welcome() {
  return (
   <Col lg="4" className='pt-2 pb-2 mb-5  rounded segundoColor '>

        <Row>
        <Col lg="6" className='bg-primary '>
        <p className='text-dark mt-3 text-center '>Bienvenido Gabriel{sessionStorage.getItem('Username')}</p>
        </Col>
        <Col lg="6" className='text-dark mt-2'>
        <Button  variant='danger' className='text-center rounded-pill mb-1'>Out</Button>
        </Col>

        </Row>
   </Col>
  )
}
